    <div>
    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:16.0pt;mso-bidi-font-size:10.0pt;line-height:105%;
    font-family:"Lucida Handwriting"'>Asia es el continente más grande y el que
    presenta la mayor diversidad de razas, culturas y lenguas del mundo. Ocupa
    una superficie de 44.614.000 kilómetros cuadrados, que representa las 4/5
    partes de la masa continental de Eurasia y que equivale a 1/3 de la
    superficie terrestre total.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:16.0pt;mso-bidi-font-size:10.0pt;line-height:105%;
    font-family:"Lucida Handwriting"'>Tiene los puntos más altos y más
    profundos de la superficie de la Tierra, la costa más larga de cualquier
    continente y, debido a su amplitud, presenta condiciones climáticas muy
    diversas y una amplia biodiversidad.<o:p></o:p></span></b></p>
    </div>
